import React, { Component } from 'react';

class Register extends Component{
    constructor(props){
        super(props);
        this.state = {}
    }
    render(){
        <form>
            <input type='email'/>
            <input type='password'/>
            <button>Submit</button>
        </form>
    }
}
export default Register;
